import './profile.css';
import Topbar from '../../components/topbar/Topbar';
const Profile = () => {
  return (
    <div>
      <>
        <Topbar />
        <div className="home-container">
          <Sidebar />
          <Feed />
          <Rightbar />
        </div>
      </>
    </div>
  );
};

export default Profile;
